import React, { Component } from "react";
import s from "./RandomRecipe.module.css";
import Image from "../../ui/Image";
import RandomRecipeInfo from "../randomRecipeInfo";
import Image1 from "../../assets/images/deruny.jpg";

export default class RandomRecipe extends Component {
  render() {
    return (
      <div className={s.RandomRecipe}>
        <Image id="randomRecipeImg" src={Image1} alt="" />
        <RandomRecipeInfo />
      </div>
    );
  }
}
